import React, { useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import Header from '../components/Header';
import Footer from '../components/Footer';

function ExtendParking() {
    const { id } = useParams();
    const navigate = useNavigate();
    const [additionalHours, setAdditionalHours] = useState(1);

    // Mock booking data
    const booking = {
        id: id,
        parkingName: "Central Plaza Parking",
        spotNumber: "A-123",
        startTime: "2025-02-26T14:00:00",
        endTime: "2025-02-26T18:00:00",
        price: "5.00", // per hour
        status: "active"
    };

    const formatDateTime = (dateString) => {
        const date = new Date(dateString);
        return date.toLocaleString('en-US', {
            month: 'short',
            day: 'numeric',
            year: 'numeric',
            hour: 'numeric',
            minute: 'numeric',
            hour12: true
        });
    };

    const calculateNewEndTime = () => {
        const endTime = new Date(booking.endTime);
        endTime.setHours(endTime.getHours() + additionalHours);
        return formatDateTime(endTime);
    };

    const handleExtend = () => {
        // Handle extend parking logic here
        console.log('Extending parking for', additionalHours, 'hours');
        navigate('/booking-history');
    };

    return (
        <div className="page-container">
            <Header />
            <div className="content-container">
                <div className="extend-parking">
                    <div className="section-header">
                        <h1>Extend Parking Time</h1>
                    </div>

                    <div className="extend-content">
                        <div className="current-booking">
                            <h2>Current Booking Details</h2>
                            <div className="info-card">
                                <div className="detail-row">
                                    <span className="label">Location:</span>
                                    <span>{booking.parkingName}</span>
                                </div>
                                <div className="detail-row">
                                    <span className="label">Spot Number:</span>
                                    <span>{booking.spotNumber}</span>
                                </div>
                                <div className="detail-row">
                                    <span className="label">Current End Time:</span>
                                    <span>{formatDateTime(booking.endTime)}</span>
                                </div>
                                <div className="detail-row highlight">
                                    <span className="label">New End Time:</span>
                                    <span>{calculateNewEndTime()}</span>
                                </div>
                            </div>
                        </div>

                        <div className="extend-options">
                            <h2>Select Additional Time</h2>
                            <div className="info-card">
                                <div className="time-selector">
                                    <button 
                                        className={`time-option ${additionalHours === 1 ? 'selected' : ''}`}
                                        onClick={() => setAdditionalHours(1)}
                                    >
                                        <span className="time">1 Hour</span>
                                        <span className="price">${booking.price}</span>
                                    </button>
                                    <button 
                                        className={`time-option ${additionalHours === 2 ? 'selected' : ''}`}
                                        onClick={() => setAdditionalHours(2)}
                                    >
                                        <span className="time">2 Hours</span>
                                        <span className="price">${(parseFloat(booking.price) * 2).toFixed(2)}</span>
                                    </button>
                                    <button 
                                        className={`time-option ${additionalHours === 4 ? 'selected' : ''}`}
                                        onClick={() => setAdditionalHours(4)}
                                    >
                                        <span className="time">4 Hours</span>
                                        <span className="price">${(parseFloat(booking.price) * 4).toFixed(2)}</span>
                                    </button>
                                </div>

                                <div className="price-summary">
                                    <div className="price-row">
                                        <span>Rate per hour</span>
                                        <span>${booking.price}</span>
                                    </div>
                                    <div className="price-row">
                                        <span>Additional hours</span>
                                        <span>{additionalHours}</span>
                                    </div>
                                    <div className="price-row total">
                                        <span>Total to pay</span>
                                        <span>${(parseFloat(booking.price) * additionalHours).toFixed(2)}</span>
                                    </div>
                                </div>

                                <button onClick={handleExtend} className="primary-button full-width">
                                    Extend Parking Time
                                </button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            <Footer />
        </div>
    );
}

export default ExtendParking;
